def transform(sequence):
    zero_idx = sequence.find('0')
    non_zero_idx = zero_idx
    while sequence[non_zero_idx] == '0':
        non_zero_idx += 1
    return sequence[zero_idx:non_zero_idx] + sequence[:zero_idx] + sequence[non_zero_idx:]

def transform(sequence):
    sequence_list = list(sequence)
    zeros = [i for i, x in enumerate(sequence_list) if x == "0"]
    nonzero = [i for i, x in enumerate(sequence_list) if x != "0"]

    for i in zeros:
        sequence_list[i] = ""
    for i in nonzero:
        sequence_list[i] = "0"

    start = min(zeros)
    end = max(nonzero)

    for i in range(start, end + 1):
        sequence_list[i] = sequence[i]

    return "".join(sequence_list)
